			Kontakt nettstedsadministratoren din om du mener dette er en feil.','The request is not signed correctly.'=>'Forespørselen var ikke signert riktig.','This request method does not support body parameters.'=>'Denne forespørselsmetoden støtter ikke parametre i meldingskroppen.','This request method is not supported.'=>'Denne forespørselsmetoden er ikke støttet.','The request method is missing.'=>'Forespørelsmetoden mangler.','You cannot call this method until Jetpack Config is configured'=>'Du kan ikke kalle denne metoden før Jetpack Config er konfigurert','Error Details: %s'=>'Detaljer om feil: %s','The Client ID/WP.com Blog ID of this site'=>'Klient-id-en/WP.com-blogg-id-en for dette nettstedet','Jetpack Plugin Version'=>'Versjon av utvidelsen Jetpack ','The number of sites of the connected WP.com user'=>'Antall nettsteder for den tilkoblede WP.com-brukeren','The WP.com user email of the connected user'=>'Den tilkoblede brukerens e-postadresse på WP.com','The WP.com username of the connected user'=>'Brukernavnet på WP.com for den tilkoblede brukeren','The WP.com user ID of the connected user'=>'Bruker-id på WP.com for den tilkoblede brukeren','Domain `%1$s` just failed is_usable_domain check as it is a subdomain of WordPress.com.'=>'Domenet `%1$s` besto nylig ikke kontrollen \'is_usable_domain\' fordi det er et underdomene av WordPress.com.','Domain `%1$s` just failed is_usable_domain check as it uses an invalid top level domain.'=>'Domenet `%1$s` besto nylig ikke kontrollen \'is_usable_domain\' fordi det bruker et ugyldig toppnivådomene.','Domain `%1$s` just failed is_usable_domain check as it is in the forbidden array.'=>'Domenet `%1$s` besto nylig ikke kontrollen \'is_usable_domain\' fordi det er blant en rekke forbudte.','Domain `%1$s` just failed is_usable_domain check as it is empty.'=>'Domenet `%1$s` besto nylig ikke kontrollen \'is_usable_domain\' fordi det er tomt.','Invalid Registration State'=>'Ugyldig registreringsstatus','Error Details: Jetpack ID begins with a numeral. Do not publicly post this error message! %s'=>'Feil-detaljer: Jetpack-id-en begynner med et siffer. Ikke publiser denne feilmeldingen! %s','Error Details: Jetpack ID is not a scalar. Do not publicly post this error message! %s'=>'Feildetaljer: Jetpack-id-en er ikke numerisk. Ikke publiser denne feilmeldingen! %s','Error Details: Jetpack ID is empty. Do not publicly post this error message! %s'=>'Feil-detaljer: Jetpack-id-en er tom. Ikke publiser denne feilmeldingen! %s','PHP\'s XML extension is not available. Jetpack requires the XML extension to communicate with WordPress.com. Please contact your hosting provider to enable PHP\'s XML extension.'=>'XML-tilleget i PHP er ikke tilgjengelig. Jetpack krever XML-tillegget for å kommunisere med WordPress.com. Kontakt nettverten/leverandøren din for å slå på XML-tillegget i PHP.','Jetpack experienced an issue trying to save options (cannot_save_secrets). We suggest that you contact your hosting provider, and ask them for help checking that the options table is writable on your site.'=>'Jetpack opplevde nylig et problem med å lagre innstillinger (cannot_save_secrets). Vi anbefaler at du kontakter nettvert/leverandør og spør om hjelp til å kontrollere at tabellen \'options\' på nettstedet ditt er skrivbar.','Could not confirm new owner.'=>'Kunne ikke bekrefte ny eier.','New owner is not connected'=>'Ny eier er ikke koblet til','New owner is same as existing owner'=>'Ny eier er samme som eksisterende eier','New owner is not admin'=>'Ny eier er ikke admin','Last heartbeat sent at: %s'=>'Siste hjerteslag sendt: %s','%s is not a valid command.'=>'%s er ikke en gyldig kommando.','Your connection with WordPress.com seems to be broken. If you\'re experiencing issues, please try reconnecting.'=>'Tilkoblingen din til WordPress.com ser ut til å være skadet. Om du opplever problemer, forsøk å koble til på nytt.','The required "local_user" parameter is missing.'=>'Den påkrevde parameteren "local_user" mangler.','Failed to fetch user token from WordPress.com.'=>'Mislyktes hente bruker-adgangstegn fra WordPress.com.','A non-empty nonce must be supplied.'=>'En ikke-tom engangskode på leveres.','Valid user is required.'=>'En gyldig bruker er påkrevd.','Jetpack is already connected.'=>'Jetpack er allerede koblet til.','Blog is already registered'=>'Bloggen er allerede registrert','There was an unspecified error registering the site'=>'Det opsto en uspesifisert feil ved registrering av nettstedet','There was an issue validating this request.'=>'Det oppsto et problem med å validere denne forespørelen.','The required "nonce" parameter is missing.'=>'Den påkrevde parameteren "nonce" mangler.','Valid user is required'=>'Gyldig bruker er påkrevd','User not found.'=>'Buker ikke funnet.','Invalid user identifier.'=>'Ugyldig brukeridentifikator.','Unable to load class %1$s. Please add the package that contains it using composer and make sure you are requiring the Jetpack autoloader'=>'Kunne ikke laste klassen %1$s. Legg til pakken som innholder den med Composer og pass på at du krever Jetpacks autolaster.','Textdomain aliases should be registered before the %1$s hook. This notice was triggered by the %2$s domain.'=>'Tekstdomene-aliaser må registereres før %1$s-kroken. Denne merknaden ble utløst av domenet %2$s.','Script "%s" depends on wp-i18n but does not specify "textdomain"'=>'Skriptet "%s" er avhengig av wp-i18n, men spesifiserer ikke noe "texdomain"','Dashboard'=>'Kontrollpanel','Your installation of Jetpack Protect is incomplete. If you installed Jetpack Protect from GitHub, please refer to <a href="%1$s" target="_blank" rel="noopener noreferrer">this document</a> to set up your development environment. Jetpack Protect must have Composer dependencies installed and built via the build command.'=>'Installasjonen din av Jetpack Beskytt er ufullstending. Hvis du installerte Jetpack Beskytt fra GitHub, referer til <a href="%1$s" target="_blank" rel="noopener noreferrer">dette dokumentet</a> for å sette opp utviklingsmiljøet ditt. Jetpack Beskytt må ha Composer-avhengigheter installert og bygget med \'build\'-kommandoen.','Error loading autoloader file for Jetpack Protect plugin'=>'Feil ved lasting av autolastingsfilen for utvidelsen Jetpack Beskytt','Security tools that keep your site safe and sound, from posts to plugins.'=>'Sikkerhetsverktøy som holder nettstedet ditt trygt og sunt, fra innlegg til utvidelser.','https://wordpress.org/plugins/jetpack-protect'=>'https://nb.wordpress.org/plugins/jetpack-protect','Jetpack Protect'=>'Jetpack Beskytt']];